// Initialize daily pull session
const sessionId = require('crypto').randomBytes(16).toString('hex');

console.log('=================================');
console.log('PropertyRadar Daily Pull Started');
console.log(`Session ID: ${sessionId}`);
console.log('=================================');

return [{
  json: {
    session_id: sessionId,
    started_at: new Date().toISOString(),
    source: 'propertyradar'
  }
}];

// Extract broker info and initialize pull tracking
const broker = $input.first().json;
const sessionId = $('Initialize Session').first().json.session_id;

console.log(`\n--- Processing Broker: ${broker.company_name} ---`);
console.log(`Daily Lead Capacity: ${broker.daily_lead_capacity}`);

return [{
  json: {
    session_id: sessionId,
    broker_id: broker.id,
    broker_name: broker.company_name,
    daily_target: broker.daily_lead_capacity || 250,
    leads_pulled_today: 0,
    source: 'propertyradar'
  }
}];

// Get current ZIP and check if we've hit daily target
const territory = $input.first().json;
const brokerState = $('Init Broker Pull').first().json;

// Check if we've already hit target
if (brokerState.leads_pulled_today >= brokerState.daily_target) {
  console.log(`Target reached: ${brokerState.leads_pulled_today}/${brokerState.daily_target}`);
  return [{
    json: {
      ...brokerState,
      skip_remaining: true,
      reason: 'daily_target_reached'
    }
  }];
}

// Calculate query signature for bookmark
const crypto = require('crypto');
const querySigData = {
  broker_id: territory.broker_id,
  zip_code: territory.zip_code,
  filters: {
    age_min: 62,
    equity_min: 150000,
    equity_percent_min: 40,
    owner_occupied: true,
    property_types: ['SFR', 'DPX', 'TPX', 'FPX', 'CND'],
    avm_min: 400000,
    avm_max: 3000000,
    cltv_max: 60
  }
};
const querySig = crypto.createHash('sha256').update(JSON.stringify(querySigData)).digest('hex');

console.log(`Processing ZIP ${territory.zip_code} (${territory.market_name})`);

return [{
  json: {
    ...brokerState,
    current_zip: territory.zip_code,
    market_name: territory.market_name,
    territory_id: territory.id,
    query_sig: querySig
  }
}];

// Skip to end of broker processing
console.log('Skipping remaining ZIPs - daily target reached');
return [$input.first().json];

// Merge bookmark data with current state
const currentState = $('Prepare ZIP Pull').first().json;
const bookmark = $input.first().json;

return [{
  json: {
    ...currentState,
    bookmark_id: bookmark.id,
    last_page: bookmark.last_page_fetched || 0,
    start_offset: (bookmark.last_page_fetched || 0) * 50
  }
}];

// Extract PropertyRadar results and check for duplicates
const response = $input.first().json;
const results = response.results || [];
const state = $('Merge Bookmark').first().json;

console.log(`API Response: ${results.length} records, Total Cost: $${response.totalCost}, Total Available: ${response.totalResultCount}`);

if (results.length === 0) {
  console.log('No more results for this ZIP');
  return [{
    json: {
      ...state,
      no_results: true,
      radar_ids: []
    }
  }];
}

// Extract radar_ids for dedup check
const radarIds = results.map(r => r.RadarID);

return [{
  json: {
    ...state,
    radar_ids: radarIds,
    raw_results: results,
    result_count: results.length,
    total_available: response.totalResultCount,
    api_cost: parseFloat(response.totalCost || 0)
  }
}];

// Stop-when-known triggered - these leads already processed
const state = $('Extract Radar IDs').first().json;

console.log(`Stop-when-known: ${state.radar_ids.length} leads already seen in ZIP ${state.current_zip}`);

return [{
  json: {
    ...state,
    stopped: true,
    reason: 'already_seen'
  }
}];

// Parse PropertyRadar results into lead format
const state = $('Extract Radar IDs').first().json;
const results = state.raw_results;
const brokerId = state.broker_id;

const crypto = require('crypto');

const leads = results.map(prop => {
  // Compute address hash for fallback dedup
  const line1 = (prop.Address || '').toUpperCase().trim();
  const city = (prop.City || '').toUpperCase().trim();
  const stateCode = (prop.State || '').toUpperCase().trim();
  const zip = (prop.ZipFive || '').substring(0, 5);
  const normalized = `${line1}|${city}|${stateCode}|${zip}`;
  const addrHash = crypto.createHash('sha256').update(normalized).digest('hex');

  return {
    radar_id: prop.RadarID,
    property_address: prop.Address,
    property_city: prop.City,
    property_state: prop.State,
    property_zip: prop.ZipFive,
    property_value: prop.AVM,
    estimated_equity: prop.AvailableEquity,
    age: prop.Age || null,
    owner_occupied: prop.isSameMailingOrExempt === 1,
    apn: prop.APN || null,
    county_fips: prop.FIPS || null,
    addr_hash: addrHash,
    assigned_broker_id: brokerId,
    source: 'propertyradar',
    radar_property_data: prop,
    radar_api_version: 'v1'
  };
});

console.log(`Parsed ${leads.length} PropertyRadar leads`);

return leads.map(lead => ({ json: lead }));

// Update lead count and check if we should continue
const state = $('Prepare ZIP Pull').first().json;
const newCount = state.leads_pulled_today + 1;

console.log(`Progress: ${newCount}/${state.daily_target} leads`);

return [{
  json: {
    ...state,
    leads_pulled_today: newCount
  }
}];

// Check if we need to continue to next ZIP
const state = $input.first().json;

console.log(`ZIP ${state.current_zip} complete. Moving to next ZIP...`);

return [state];

// Broker processing complete
const state = $input.first().json;

console.log(`\nâœ“ Broker ${state.broker_name} complete: ${state.leads_pulled_today}/${state.daily_target} leads`);

return [state];

// Final summary
const sessionId = $('Initialize Session').first().json.session_id;

console.log('\n=================================');
console.log('PropertyRadar Daily Pull Complete');
console.log(`Session ID: ${sessionId}`);
console.log('=================================');

return [{
  json: {
    session_id: sessionId,
    status: 'complete',
    completed_at: new Date().toISOString()
  }
}];
